async function GetEurUsd() {
  const apiURL = "https://v6.exchangerate-api.com/v6/e309146a2616c35941e159ef/latest/EUR";
  return await fetch(apiURL)
    .then((res) => res.json())
    .then((response) => {
      const { conversation_rates = {} } = response;
        const EURUSD = conversation_rates.USD
        return EURUSD;
    });
}

export default GetEurUsd;
